import React from 'react';
import styled from 'styled-components';
import { Title } from '../auth-info';

const Wrapper = styled.div`
  width: 844px;
  margin: 130px auto 50px;
  font-family: MuseoSansMedium,sans-serif;
`

const InfoTitle = styled(Title)`
  width: 568px;
  height: 64px;
  font-size: 26px;
  color: #001424;
  font-weight: 700;
`

export const Info = () => {
  return <Wrapper>
    <InfoTitle>
      Автоматическое заполнение профиля и обогащение его персонализированными данными с согласия клиента *
    </InfoTitle>
  </Wrapper>
}
